import avatar from '../img/avatar.png';

const Home = () => {
    return (
        <div className=" h-fit grid grid-cols-2 gap-4">
            <div className='bg-pink-200 flex flex- justify-center'>
                <p>Hey there! I'm Dianne.</p>
                <p>I enjoy creating sleek and elegant web experiences. I'm enthusiastic about front-end development because it allows me to unleash my creativity by building interfaces that captivate and engage users. Additionally, I'm passionate about developing mobile applications and exploring innovative ways to bring functionality and beauty to handheld devices.</p>
            </div>

            <div>
                <img src={avatar} className=' animate-bounce' />
            </div>

        </div>
    );
}

export default Home;
